import React from "react";

export class Table extends React.Component {
    render() {
        return (
            <div>

                <h3>{this.props.title}</h3>
                <table className="table table-dark table-hover">
                    <tbody>
                        {this.props.module}
                        {this.props.title === 'summary' && 
                         (<tr>
                            <td>Total Module</td>
                            <td>{this.props.total}</td>
                          </tr>)}
                    </tbody>

                </table>
            </div>
        )
    }
}
